    false,nt"url": null,nt"notes": "Spill responders should become familiar
    with the contacts and other information contained in this Contingency Plan before
    a spill occurs. Spill cleanup methods vary depending upon the type of material spilled
    and the location of the spill. Federal, state, and private contractors know how
    to cleanup spills of oil and hazardous materials. Therefore, the information contained
    in this Contingency Plan is designed to: (1) provide a readily available list of
    contacts that may be involved in a spill cleanup and (2) provide those involved
    in the cleanup with the locations of valuable fish and wildlife species and habitats
    and other natural resources that need to be protected.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
